/*Table structure for table `period` */

DROP TABLE IF EXISTS `period`;

CREATE TABLE `period` (
  `nIdHotel` tinyint(2) unsigned NOT NULL,
  `nIdPeriod` tinyint(3) unsigned NOT NULL,
  `dStartPeriod` date NOT NULL,
  `dEndPeriod` date NOT NULL,
  `tDescription` varchar(50) NOT NULL,
  `tStatus` char(1) default 'A',
  PRIMARY KEY  (`nIdHotel`,`nIdPeriod`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `period` */

insert  into `period`(`nIdHotel`,`nIdPeriod`,`dStartPeriod`,`dEndPeriod`,`tDescription`,`tStatus`) values (1,1,'2008-01-01','2008-12-31','ALL 2008','A'),(1,2,'2009-01-01','2009-12-31','ALL 2009','A');

/*Table structure for table `rate` */

DROP TABLE IF EXISTS `rate`;

CREATE TABLE `rate` (
  `nIdHotel` smallint(2) unsigned NOT NULL,
  `nIdRate` smallint(2) unsigned NOT NULL auto_increment,
  `tRateCode` char(2) default NULL,
  `tDescription` varchar(20) default NULL,
  `tStatus` char(1) default 'A',
  PRIMARY KEY  (`nIdHotel`,`nIdRate`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

/*Data for the table `rate` */

insert  into `rate`(`nIdHotel`,`nIdRate`,`tRateCode`,`tDescription`,`tStatus`) values (1,1,'FR','FULL RATE','A'),(1,2,'C1','CONFIDENCIAL 1','A'),(1,3,'C2','CONFIDENCIAL 2','A'),(1,4,'C3','CONFIDENCIAL 3','A');

/*Table structure for table `reservation` */

DROP TABLE IF EXISTS `reservation`;

CREATE TABLE `reservation` (
  `nIdHotel` tinyint(1) unsigned NOT NULL,
  `nIdReservation` smallint(5) unsigned NOT NULL auto_increment,
  `tReservationType` varchar(1) NOT NULL default 'I',
  `dArrival` date NOT NULL,
  `dDeparture` date NOT NULL,
  `nNights` tinyint(3) unsigned NOT NULL,
  `nAdults` tinyint(3) unsigned NOT NULL default '1',
  `nChildren` tinyint(3) unsigned default '0',
  `tRoomType` varchar(2) NOT NULL,
  `nQuantity` smallint(6) unsigned NOT NULL default '1',
  `tRoomNumber` varchar(4) default NULL,
  `tVipCode` char(1) default '3',
  `nIdSource` smallint(5) unsigned NOT NULL,
  `nRoomRate` decimal(10,2) NOT NULL,
  `nTotalRoom` decimal(10,2) NOT NULL,
  `dPaymentDue` date default NULL,
  `nPaymentType` tinyint(3) unsigned default NULL,
  `tVoucher` varchar(10) default NULL,
  `tHotelInstructions` varchar(120) default NULL,
  `tGuestInstructions` varchar(120) default NULL,
  `tMadeBy` varchar(3) default NULL,
  `dMadeOn` datetime default NULL,
  `tUpdatedBy` varchar(3) default NULL,
  `dLastUpdate` datetime default NULL,
  `tStatus` varchar(1) NOT NULL default 'T',
  PRIMARY KEY  (`nIdHotel`,`nIdReservation`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=214 ROW_FORMAT=DYNAMIC COMMENT='InnoDB free: 22528 kB';

