/*Trigger structure for table `reservation` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tgReservation_AI` */$$

/*!50003 CREATE TRIGGER `tgReservation_AI` AFTER INSERT ON `reservation` FOR EACH ROW BEGIN
    DECLARE occDay date;
    DECLARE quantity int;
    /*SET occDay = NEW.dArrival;*/
    SET quantity = 1;
    WHILE quantity <= NEW.nQuantity DO
      SET occDay = NEW.dArrival;
      REPEAT
        INSERT INTO occupation VALUES
	      (NEW.nHotelId,     NEW.tRoomType, occDay,
	       NEW.nReservation, NEW.tReservationType,         NEW.nQuantity,
	       NEW.tRoomNumber,  NEW.nAdults,   NEW.nChildren, NEW.tStatus);
        SET occDay = adddate(occDay, INTERVAL 1 DAY);
      UNTIL occDay >= NEW.dDeparture
      END REPEAT;
      SET quantity = quantity + 1;
    END WHILE;
END */$$


/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tgReservation_AU` */$$

/*!50003 CREATE TRIGGER `tgReservation_AU` AFTER UPDATE ON `reservation` FOR EACH ROW BEGIN
##  DECLARE nights tinyint(3) unsigned;
  DECLARE occDay date;
  DECLARE quantity int;

/* If any of arrival, departure or quantity vary,
 then delete all records in 'occupation' table
*/
  IF NEW.dArrival   = OLD.dArrival   AND
     NEW.dDeparture = OLD.dDeparture AND
     NEW.nQuantity  = OLD.nQuantity THEN
     UPDATE occupation
        SET tRoomType          = NEW.tRoomType,
            tRoomNumber        = NEW.tRoomNumber,
            nAdults            = NEW.nAdults,
            nChildren          = NEW.nChildren,
            tStatus            = NEW.tStatus
      WHERE nHotelId = NEW.nHotelId AND nReservation = NEW.nReservation;
  ELSE
     DELETE FROM occupation
            WHERE nHotelId       = NEW.nHotelId AND
                  nReservation = NEW.nReservation;
## Arrival MUST BE less than Departure !!
     SET quantity = 1;
     WHILE quantity <= NEW.nQuantity DO
       SET occDay = NEW.dArrival;
       REPEAT
         INSERT INTO occupation
           VALUES (NEW.nHotelId, NEW.tRoomType, occDay, NEW.nReservation, NEW.tRoomNumber,
                   NEW.nAdults,  NEW.nChildren, NEW.tStatus);
       SET occDay = adddate(occDay, INTERVAL 1 DAY);
       UNTIL occDay >= NEW.dDeparture
       END REPEAT;
       SET quantity = quantity + 1;
     END WHILE;
  END IF;
END */$$


DELIMITER ;

