/* Procedure structure for procedure `CMSP_AVAILABLE_STAY` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_AVAILABLE_STAY` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_AVAILABLE_STAY`(
		IN h INT,
		IN rt char(02),
		IN ad date,
		IN dd date )
BEGIN
	DECLARE a int;
	SELECT tRoomType, dOccupationDay, COUNT(dOccupationDay)
	  FROM occupation
	 WHERE nIdHotel = h
	   AND tRoomType = rt
	   AND dOccupationDay >= ad
	   AND dOccupationDay < dd
	GROUP BY dOccupationDay;
END */$$
DELIMITER ;

/* Procedure structure for procedure `CMSP_CUSTOMER_DELETE` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_CUSTOMER_DELETE` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_CUSTOMER_DELETE`(IN p_idCustomer varchar(06),
								 IN p_hotelRegistration varchar(03) )
BEGIN
	UPDATE customer
	   SET tStatus = "*"
	 WHERE nIdCustomer = p_idCustomer
	   AND nHotelRegistration = p_hotelRegistration;
END */$$
DELIMITER ;

/* Procedure structure for procedure `CMSP_CUSTOMER_GET` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_CUSTOMER_GET` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_CUSTOMER_GET`(
			IN p_idCustomer	varchar(06),
			IN p_documentNumber varchar(12),
			IN p_hotelRegistration	varchar(03))
BEGIN
	SELECT
		nIdCustomer			idCustomer,
		tLastName1			lastname1,
		tLastName2			lastname2,
		tFirstNames			firstnames,
		DATE_FORMAT(dBirthDate,'%d/%m/%Y')
							birthdate,
		nIdNationality 		nationality,
		nTitle 				title, -- Sr., Sra.
		nDocumentType 		documentType,
		tDocumentNumber 	documentNumber,
		tAddress1 			address1,
		tAddress2 			address2,
		tDistrict 			district,
		tCity 				city,
		nIdCountry 			idCountry,
		tZipCode 			zipCode,
		nPhone1 			phone1,
		nPhone2 			phone2,
		nMovilPhone			movilPhone,
		tEmail 				email,
		tOccupation 		occupation,
		nVipStatus 			vip,
		tRequests 			requests,
		nHotelRegistration	hotelRegistration,
		tMadeBy 			madeBy,
		DATE_FORMAT(dMadeOn,'%d/%m/%Y')	madeOn,
		tStatus 			status
	  FROM customer
	 WHERE ( p_idCustomer = nIdCustomer
			OR p_documentNumber = tDocumentNumber )
	   AND p_hotelRegistration = nHotelRegistration
	   AND tStatus <> '*';
    END */$$
DELIMITER ;

/* Procedure structure for procedure `CMSP_CUSTOMER_INSERT` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_CUSTOMER_INSERT` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_CUSTOMER_INSERT`(
					   OUT p_idCustomer			int,
						IN p_lastname1			varchar(15),
						IN p_lastname2			varchar(15),
						IN p_firstnames			varchar(20),
						IN p_birthdate			date,
						IN p_nationality		tinyint,
						IN p_title				varchar(3),
						IN p_documentType		tinyint,
						IN p_documentNumber		varchar(12),
						IN p_address1			varchar(50),
						IN p_address2			varchar(50),
						IN p_district			varchar(15),
						IN p_city				varchar(15),
						IN p_idCountry			tinyint,
						IN p_zipCode			varchar(5),
						IN p_phone1				integer,
						IN p_phone2				integer,
						IN p_movilPhone			integer,
						IN p_email				varchar(50),
						IN p_occupation			varchar(20),
						IN p_vipStatus			tinyint,
						IN p_requests			tinytext,
						IN p_hotelRegistration	tinyint,
						IN p_madeBy				smallint,
						IN p_status				char(1) )
BEGIN
    INSERT INTO customer(
			tLastName1, tLastName2, tFirstNames,
			tBirthDate, nIdNationality, tTitle, nDocumentType,
			tDocumentNumber, tAddress1, tAddress2, tDistrict,
			tCity, nIdCountry, tZipCode, nPhone1, nPhone2,
			nMovilPhone, tEmail, tOccupation, nVipStatus,
			tRequests, nHotelRegistration, tMadeBy, dMadeOn )/*tStatus )*/
				VALUES(
			p_lastname1, p_lastname2, p_firstNames,
			p_birthDate, p_idNationality, p_title, p_documentType,
			p_documentNumber, p_address1, p_address2, p_district,
			p_city, p_idCountry, p_zipCode, p_phone1, p_phone2,
			p_movilPhone, p_email, p_occupation, p_vipStatus,
			p_requests, p_hotelRegistration, p_madeBy, CURRENT_TIMESTAMP() ); /*p_Status);*/
END */$$
DELIMITER ;

/* Procedure structure for procedure `CMSP_CUSTOMER_LIST` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_CUSTOMER_LIST` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_CUSTOMER_LIST`(
					IN p_idHotel INT, IN param VARCHAR(25) )
BEGIN
	SELECT 	nIdCustomer			idCustomer,
			CONCAT(tLastName1, CONCAT(', ',tFirstNames) )
								customerNames,
			DATE_FORMAT(dBirthDate,'%d/%m/%Y')
								birthdate,
			nIdNationality		idNationality,
			ct.tNationality		desNationality,
			nTitle				title,
			nDocumentType		documentType,
			tDocumentNumber		documentNumber,
			tAddress1			address1,
			tAddress2			address2,
			tDistrict			district,
			tCity				city,
			c.nIdCountry		idCountry,
			tZipCode			zipCode,
			CONCAT(nPhone1, nPhone2, nMovilPhone)
								phones,
			tEmail				email,
			tOccupation			occupation,
			nVipStatus			vipStatus,
			tRequests			requests,
			nHotelRegistration	hotelRegistration,
			tMadeBy				madeBy,
			DATE_FORMAT(dMadeOn,'%d/%m/%Y')
								madeOn
	  FROM customer c
			LEFT JOIN country ct ON c.nIdNationality = ct.nIdCountry
	 WHERE c.nHotelRegistration = p_idHotel
	   AND c.tLastName1 LIKE CONCAT('%', param ,'%')
     ORDER BY c.tLastName1;
END */$$
DELIMITER ;

/* Procedure structure for procedure `CMSP_CUSTOMER_UPDATE` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_CUSTOMER_UPDATE` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_CUSTOMER_UPDATE`(
					    IN p_idCustomer			varchar(06),
						IN p_lastname1			varchar(15),
						IN p_lastname2			varchar(15),
						IN p_firstnames			varchar(20),
						IN p_birthdate			varchar(10),
						IN p_nationality		varchar(02),
						IN p_title				varchar(03),
						IN p_documentType		varchar(02),
						IN p_documentNumber		varchar(12),
						IN p_address1			varchar(50),
						IN p_address2			varchar(50),
						IN p_district			varchar(15),
						IN p_city				varchar(15),
						IN p_idCountry			varchar(02),
						IN p_zipCode			varchar(05),
						IN p_phone1				varchar(10),
						IN p_phone2				varchar(10),
						IN p_movilPhone			varchar(10),
						IN p_email				varchar(50),
						IN p_occupation			varchar(20),
						IN p_vipStatus			varchar(01),
						IN p_requests			tinytext,
						IN p_hotelRegistration	varchar(02),
						IN p_madeBy				varchar(05),
						IN p_status				char(01) )
BEGIN
	declare v_birthdate date;
	-- TODO: test if
	if !strcmp(p_birthdate,'1971-08-12') then
	   set v_birthdate = 1969-12-31;
	else
	   set v_birthdate = STR_TO_DATE(p_birthDate,'%d/%m/%Y');
	end if;
    UPDATE customer SET
			tLastName1			= p_lastname1,
			tLastName2			= p_lastname2,
			tFirstNames			= p_firstNames,
			dBirthDate			= v_birthdate,
			nIdNationality		= p_idNationality,
			tTitle				= p_title,
			nDocumentType		= p_documentType,
			tDocumentNumber		= p_documentNumber,
			tAddress1			= p_address1,
			tAddress2			= p_address2,
			tDistrict			= p_district,
			tCity				= p_city,
			nIdCountry			= p_idCountry,
			tZipCode			= p_zipCode,
			nPhone1				= p_phone1,
			nPhone2				= p_phone2,
			nMovilPhone			= p_movilPhone,
			tEmail				= p_email,
			tOccupation			= p_occupation,
			nVipStatus			= p_vipStatus,
			tRequests			= p_requests,
			nHotelRegistration	= p_hotelRegistration,
			tMadeBy				= p_madeBy,
			dMadeOn				= CURRENT_TIMESTAMP(),
			tStatus				= p_Status
	WHERE 	nIdCustomer			= p_idCustomer;
END */$$
DELIMITER ;

