DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_RESERVATION_UPDATE`(
						IN p_idHotel varchar(02),
						IN p_idReservation varchar(06),
						IN p_arrival varchar(10),
						IN p_departure varchar(10),
						IN p_nights varchar(03),
						IN p_adults varchar(02),
						IN p_children varchar(02),
						IN p_roomType varchar(02),
						IN p_quantityRooms varchar(02),
						IN p_roomNumber varchar(04),
						IN p_idSource varchar(06),
						IN p_roomRate decimal(10,2),
						IN p_totalRoom decimal(10,2),
						IN p_paymentDue varchar(10),
						IN p_paymentType varchar(02),
						IN p_resStatus varchar(01),
						IN p_hotelInstructions varchar(120),
						IN p_guestInstructions varchar(120),
						IN p_updateBy varchar(03) )
BEGIN
        UPDATE reservation
		   SET	dArrival     = STR_TO_DATE(p_arrival,'%d/%m/%Y'),
				dDeparture   = STR_TO_DATE(p_departure,'%d/%m/%Y'),
				nNights      = p_nights,
				nAdults      = p_adults,
				nChildren    = p_children,
				tRoomType    = p_roomType,
				nQuantity    = p_quantityRooms,
				tRoomNumber  = p_roomNumber,
				nIdSource    = p_idSource,
				nRoomRate    = p_roomRate,
				nTotalRoom   = p_totalRoom,
				dPaymentDue  = STR_TO_DATE(p_paymentDue,'%d/%m/%Y'),
				nPaymentType = p_paymentType,
				tStatus      = p_resStatus,
				tHotelInstructions = p_hotelInstructions,
				tGuestInstructions = p_guestInstructions,
				tUpdatedBy   = p_updateBy,
				dLastUpdate  = CURDATE()
		 WHERE nIdHotel = p_idHotel
		   AND nIdReservation = p_idReservation;
END */$$
DELIMITER ;

