/* Procedure structure for procedure `CMSP_VAL_ROOMTYPE_ST` */

/*!50003 DROP PROCEDURE IF EXISTS  `CMSP_VAL_ROOMTYPE_ST` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CMSP_VAL_ROOMTYPE_ST`(
	IN h INT, IN t char(02),IN d date )
BEGIN
	DECLARE a int;
	SELECT nAvailableRooms INTO a
	  FROM roomtype_status
	 WHERE nIdHotel = h
	   AND tRoomType = t
	   AND dStatusDate = d
		   LIMIT 1;
	IF a IS NULL THEN
		INSERT INTO roomtype_status VALUES(h,t,d,1,0,0,0,0,0,"I");
	END IF;
	SET @x = a;
END */$$
DELIMITER ;

/* Procedure structure for procedure `SP_DO_ITERATE` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_DO_ITERATE` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_DO_ITERATE`(p1 INT)
BEGIN
	label1: LOOP
	SET p1 = p1 + 1;
	IF p1 < 10 THEN
		ITERATE label1; END IF;
	LEAVE label1;
	END LOOP label1;
	SET @x = p1;
END */$$
DELIMITER ;

